  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Medicine Lake
  NWR outlines Refuge accomplishments from May through July of 1939. The report begins
  by summarizing the weather conditions during this period. Wildlife- including migratory
  birds, upland game birds, furbearers, rodents, and disease- is also covered. The
  Refuge development and maintenance section discusses physical developments. Resource
  management is outlined; topics include grazing. The public relations section of
  the report describes recreational uses and Refuge visitors. Photographs are attached.\",\n\t\"owner_org\":
